import { Divider } from './skl-ds-divider';

export default {
  title: 'Example/Atoms/skl-ds-divider',
  component: Divider,
  argTypes: {
    color: {
      control: 'color',
      description: 'Colore del divider',
    },
  },
};


export const Divider1 = {
  args: {
    iconName: 'alarm', 
    color: '#000', 
    size: 'small'
  }
}
